import React from 'react';


const Result = (props) => {
    console.log(props.currency)
    const checker = () => {
        if(this.props.price === "") {
            return "";
        } else {
            return '$' + parseFloat(props.price).toFixed(2);
        }
    }
    return(
        <div className = "results">
            <h3 className = "coinTitle">{props.coin}</h3>
            <h3 className = "currencyTitle">{this.checker()}</h3>
        </div>
    );
};


export default Result;
